DROP TABLE IF EXISTS `order_info`;
CREATE TABLE `order_info` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(20) NOT NULL DEFAULT '' COMMENT '订单号',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0 待支付，1 已支付 ，2 正在发货，3 已签收',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '具体地址',
  `phone` varchar(60) NOT NULL DEFAULT '' COMMENT '手机号',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '物流费',
  `pay_time` int(11) NOT NULL DEFAULT '0' COMMENT '付款时间',
  `order_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总价',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '订单时间',
  `confirm_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '确认订单时间',
  `freight_price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '配送费用',
  `order_products` int(12) DEFAULT NULL COMMENT '购买物品',
  `receiver_name` varchar(12) NOT NULL DEFAULT '' COMMENT '收件人名字',
  PRIMARY KEY (`id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`user_id`),
  KEY `order_status` (`order_status`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8mb4;

